MultiLanguageSpellData['tw'][90608] = {name = "[q4]辛洛斯，諸界毀滅者", additional_info = "3秒 施法時間 15\n[q]根據你的研究指出，這把偉大的武器曾是祖爾格拉布那名奪魂者哈卡的眾多珍藏之一。哈卡在數年前被擊敗，而此劍在化為碎片之前曾輾轉流經許多強力戰士與聖騎士的手中。顯而易見，雖然你有能力重鑄此劍，不過如果諸界毀滅者回到世上，有些麻煩事很可能也會隨之降臨，比如說，奪魂者。\n[q4]辛洛斯，諸界毀滅者\n帳號綁定\n唯一雙手 劍\n1,894 - 2,842傷害 速度 3.80\n（每秒傷害623.16）\n+341 力量\n+512 耐力\n耐久: 120 / 120\n85"}
