MultiLanguageSpellData['tw'][91224] = {name = "[q0]柔伊女皇之語", additional_info = "3秒 施法時間 5\n[q]柔伊女皇之語及柔伊女皇之誓曾是一對帶有強力魔法的對戒。你發現的這枚是柔伊女皇之語，在它被打碎時也同時喪失了魔法能力。柔伊女皇之誓雖然下落不明，但上頭的魔法能力也許還能運作。鮮少有人知道女皇本身亦為黑鐵矮人的統治者，她為龍族深深地著迷，為此有諸多矮人在竊取龍蛋或是幼龍的過程中喪命。\n[q0]柔伊女皇之語\n拾取後綁定"}
MultiLanguageSpellData['tw'][91225] = {name = "[q0]銅鬚權杖", additional_info = "3秒 施法時間 5\n[q]銅鬚這個名字同時代表了一個部族的矮人和統治它的家族。王座廳的諸多國王們在統治的期間用過許多的權杖。依照傳統習俗，國王們會讓他特定的高階顧問和盟友攜帶權杖一整天。那些日子對權杖來說可相當不容易，它們得經歷旅店的內部、從山頂被往下丟、被用來敲穴居怪之類的事情。\n[q0]銅鬚權杖\n拾取後綁定"}
MultiLanguageSpellData['tw'][91226] = {name = "[q3]旅店老闆的女兒", additional_info = "3秒 施法時間 15\n[q]根據傳說記載，布萊赫·石守在洛克莫丹附近經營的旅店還蠻成功的。他的女兒姬琳遠離家鄉出外旅行，但最終她的名聲卻使得父親蒙羞。布萊赫和一名地精術士交易，好讓他的女兒不會離家太遠。這名術士把姬琳變成了一顆爐石，這樣一來她就可以隨時回到旅店了。\n[q3]旅店老闆的女兒\n拾取後綁定\n唯一\n玩具\n[q2]使用: 將你傳送回<Hearthstone Location>。與不同地區的旅店老闆談話可以改變你家所在的位置。 (30分鐘 冷却)"}
MultiLanguageSpellData['tw'][91227] = {name = "[q4]巫士族長索瑞森法杖", additional_info = "3秒 施法時間 15\n[q]巫士族長索瑞森是黑鐵矮人於三錘之戰期間的領袖。當他敗給銅鬚氏族而失去鐵爐堡時，索瑞森撤退至赤脊山，建立了一個以他的名命名的城市。當他為了擊敗敵人孤注一擲時，竟意外地召喚出半神拉格納羅斯，但這結果導致了這位巫士族長的死亡和黑石山脈火山峰的形成。\n[q4]巫士族長索瑞森法杖\n帳號綁定\n雙手 法杖\n1,047 - 1,571傷害 速度 2.10\n（每秒傷害623.33）\n+512 耐力\n+341 智力\n耐久: 120 / 120\n85\n[q2]裝備:提高 1,955點法術能量。"}
