MultiLanguageSpellData['tw'][92137] = {name = "[q4]蠕行的爪子", additional_info = "3秒 施法時間 15\n[q]托維爾人之間流傳著這麼一則故事：蘭姆卡韓意圖要消滅某個邪惡的巨靈，而那個巨靈為了要保住他的性命，決定把自己的魂魄轉移到一隻猴子的身上。結果，他的移魂大法才施展到一半就被殺死了，所以只有一小部分的魂魄成功移轉過去—剛好足以活化的那隻猴子的手爪。\n[q4]蠕行的爪子\n拾取後綁定\n[q2]使用:  教你學會如何召喚這個夥伴。\n[q2]右鍵點擊以召喚或解散你的蠕行的爪子。"}
