MultiLanguageSpellData['tw'][92145] = {name = "[q4]甲蟲風暴墜飾", additional_info = "3秒 施法時間 15\n[q]在法老泰哈特普王朝時，維爾納爾河曾遭受毒蛇禍患侵擊。任何東西都無法驅走這些蛇。不久後出現了第二批禍患，這是一群沙漠甲蟲。甲蟲與毒蛇展開激烈廝殺，直到雙方皆滅亡後，和平才再度重返這片大地。\n[q4]甲蟲風暴墜飾\n帳號綁定\n玩具\n[q2]使用: 召喚一大群平靜的甲蟲。 (10分鐘 冷却)"}
